  // Count words in text area using a regular expression string
  function updateWordCount(input) {
    let text = $(input.target).children("p").text();
    if (text === undefined || $(input.target).children("p").length == 0) {
      text = $(input.target).text();
    }
    if (Enhanced.debug) Enhanced.log(`Input detected from ${input} with contents of \"${text}\".`);
    $("#id_message_editor-word-count").text(text.split(/\w+/gm).length - 1);
  }

